export default (function(a,b,c,d,e){return {data:{N8BB5hOCda:{data:{id:1328,attributes:{imdbId:"tt0038578",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BNTRmOTlhY2YtZmQ2YS00OGQ0LTk3NTMtY2I2YzEyYTg2M2YzXkEyXkFqcGdeQXVyMTYzMTY1MjQ@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"}],item_lang:{data:{id:1991,attributes:{title:d,plot:"When young Robert Shannon is orphaned he leaves his home in Ireland and travels to Langford, Scotland, home of his maternal grandparents. Growing up in the home of his penny-pinching grandfather is made bearable by his doting but irresponsible great-grandfather, loving grandmother and kind aunt and uncle. After a rocky start in his new school Robbie adjusts and is befriended by Gavin and Allison, whom he grows to love as the years pass. As he matures into a young man Robbie's dreams turn to medicine and becoming a doctor. Supported by everyone in the family except his grandfather, he studies for a scholarship as a way to escape life toiling in the local boiler-works.",slug:"the-green-years"}}},books:{data:[{id:7206,attributes:{title:"THE GREEN YEARS",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=GmK_6594QLcC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"1914-01-01",publisher:a,subtitle:a}},{id:7207,attributes:{title:d,description:"\"A compassionate story of a boy's growth to manhood, set against the harsh reality of life at the turn of the century. Disappointed in love and in his burning ambition to study medicine, the eighteen-year-old Robert sees his future as a blank wall. But, once again, he is saved from despair by his fiery relative, much to the chagrin of the rest of the family.\"--Cover page [4].",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=24a9ngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Archibald Joseph Cronin"],firstBook:b,published:"2013-03-28",publisher:"Policy Press",subtitle:a}},{id:7208,attributes:{title:"Green Years",description:a,thumbnail:a,authors:["A J. Cronin"],firstBook:b,published:"1969-01-01",publisher:a,subtitle:"An Environmental Resource Manual For Senior Primary And Jun"}},{id:7209,attributes:{title:"Novelettes and Short Stories of A. J. Cronin",description:"Scottish novelist and physician A. J. Cronin (1896-1981), author of \"The Citadel,\" was one of the most popular writers of the twentieth century. With his keen understanding of the human condition, his deep moral conscience and his extraordinary narrative skill, he imbues his novelettes and short stories with all the qualities that have made his many novels worldwide bestsellers. Includes the novelettes \"Child of Compassion,\" \"The Man Who Couldn't Spend Money\" and \"The Innkeeper's Wife,\" and the short stories \"Lily of the Valley,\" \"Mascot for Uncle,\" \"The Portrait\" and \"The One Chance.\"",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=_jPjAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:b,published:"2017-02-21",publisher:e,subtitle:a}},{id:7210,attributes:{title:"Adventures of a Young Doctor",description:"In 1951 Collier's magazine published \"Adventures of a Young Doctor,\" a series of six articles in which Scottish writer\u002Fphysician A. J. Cronin, bestselling author of \"The Citadel,\" chronicles his experiences-some heartwarming, some thrilling, some humorous-as a young doctor. Subsequently, these articles appeared as chapters in Cronin's larger autobiography, \"Adventures in Two Worlds\" (1952). CONTENTS: Part 1. Epidemic At Sea Part 2. The Wonderful Sleep Part 3. Dangerous Lunatic Part 4. Wuddy Houseboat Tam Part 5. A Cool Customer Part 6. Thirty-Eight Coffins",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1j4SkAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:b,published:"2016-04-01",publisher:e,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940982741}}("",null,"A. J. Cronin","The Green Years","Createspace Independent Publishing Platform"))